--
-- Name: membros_view; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.membros_view AS
 SELECT m.membro_id,
    m.created_at,
    m.nome_completo,
    m.alcunha,
    m.faccao_id,
    f.nome AS faccao_nome,
    m.fotos_path,
    m.funcao_id,
    fn.nome AS funcao_nome,
    m.nacionalidade,
    m.naturalidade,
    m.cpf,
    m.identidade,
    m.nivel_instrucao,
    m.filiacao_mae,
    m.filiacao_pai,
    m.situacao_mae,
    m.situacao_pai,
    m.historico,
    m.cargo_id,
    c.nome AS cargo_nome,
    m.cargo_ant_id,
    m.funcao_ant_id,
    m.batismo,
    m.padrinho,
    m.faccao_integrou,
    m.faccao_aliada,
    m.faccao_inimiga,
    m.faccao_senha,
    m.membro_endereco,
    m.estado_id,
    e.nome AS estado_nome,
    m.municipio_id,
    m.infopen,
    m.estado_civil,
    m.batismo_local,
    m.tres_ultimo_locais_preso,
    m.alerta,
    m.alerta_observacao,
    m.atuacao_crime,
    m.validacao_precentual,
    m.validacoes,
    m.coordenadas,
    m.validacao_observacao,
    m.identidade_orgao,
    m."membroLngLat"
   FROM ((((public.membros m
     LEFT JOIN public.estados e ON ((m.estado_id = e.estado_id)))
     LEFT JOIN public.faccoes f ON ((m.faccao_id = f.faccao_id)))
     LEFT JOIN public.cargos c ON ((m.cargo_id = c.cargo_id)))
     LEFT JOIN public.funcoes fn ON ((m.funcao_id = fn.funcao_id)));


ALTER TABLE public.membros_view OWNER TO postgres;

